function Navbar () {

    return (
        <div>
            <nav>
            <img src="https://picsum.photos/200/300" />
            <ul>
                <li>
                
                   <p>Home</p> 
                   <p>About</p> 
                   <p>Contact</p> 
                   <p>Blog</p> 
                   <p>Careers</p> 
                </li>
                
            </ul>
            </nav>
        </div>
    );

}

export default Navbar;
